description:
What do a crime boss, a couple of gangsters, and a girl named Lucy have in common? Well, the gangsters are supposed to collect on some bad debts from these hot girls that owe them, but they just keep giving them sex instead.
One of the gangsters is supposed to watch the crime boss' girlfriend, Lucy... Only he watches her a little too close. The crime boss has it out with him and winds up in even bigger trouble. It's what happens to them inside Bobbi's Pawn Shop that will change them forever.

